/* AppMode: The enumerated type for AppMode. */

const AppMode = {
    LOGIN: "LoginMode",
    ROUNDS: "RoundsMode",
    ROUNDS_LOGROUND: "RoundsMode-LogRound",
    ROUNDS_EDITROUND: "RoundsMode-EditRound",
    MAINPAGE: "MainPage",
    INFOPAGE: "InfoPage"
};

Object.freeze(AppMode); //This ensures that the object is immutable.

export default AppMode;
